function CaptainPick( props ) {
    return (
        <div className="captain-picks-general-captain-pick">
            <h2>{props.name}</h2>
            <p>{props.team}</p>
            <p>{props.cScore}</p>
        </div>
    )
}

export default CaptainPick;
